INSERT INTO `faq` (`id`, `serial`, `title`, `details`, `active`, `date`) VALUES
(70374, 1, 'নতুন সদস্য যুক্ত (Add New Members)', '<p>নতুন সদস্য যুক্ত করতে এই পাতার বাম পাশে <font color=\"#CE0000\"><span style=\"background-color: transparent;\"><b>Add New Members</b></span></font> লেখা বাটনে ক্লিক করুন। পরবর্তীতে প্রয়োজনীয় তথ্যাবলি দিয়ে <b><span style=\"background-color: transparent;\"><font color=\"#CE0000\">Submit/Add </font></span></b>করুন। প্রয়োজনে পরে যে কোনো সময় <font color=\"#0000FF\">তথ্যাবলি আপডেট </font>করতে পারবেন।<br></p>', 1, '18/06/2020 10:12:08pm'),
(55632, 2, 'নতুন নিবন্ধন কারা করেছেন! (New Registration)', '<font color=\"#CE0000\">New Registration Tab </font>এ <b><font color=\"#397B21\">Life Members </font></b>বাটনে ক্লিক করলে আজীবন সদস্য তালিকাভুক্ত <span style=\"background-color: transparent;\"><font color=\"#397B21\"><b>GDM, DDM, GM, LM </b></font></span>Category তে যদি কোনো নতুন Registration করে এখানে পাওয়া যাবে খুব সহজেই। আর যদি  <b><font color=\"#CE0000\">General Members</font></b> হয় তাহলে General Members Option এ পাবেন।<br>', 1, '21/06/2020 09:49:10am'),
(76423, 3, 'নতুন ফি দিয়েছে কারা! (New Payment)', '<p><font color=\"#CE0000\">New Payment Tab </font>এ <b><font color=\"#397B21\">Life Members </font></b>বাটনে ক্লিক করলে আজীবন সদস্য তালিকাভুক্ত <span style=\"background-color: transparent;\"><font color=\"#397B21\"><b>GDM, DDM, GM, LM </b></font></span>Category তে যদি কোনো নতুন Payment করে এখানে পাওয়া যাবে খুব সহজেই। আর যদি  <b><font color=\"#CE0000\">General Members</font></b> হয় তাহলে General Members Option এ পাবেন।</p>', 1, '21/06/2020 09:49:33am');
