ent: -13.7pt;\">3) Distinguished Donor Member:</b><span style=\"font-size: 1em; text-indent: -13.7pt;\"> Donation for a Distinguished Donor Member will be Tk. 50,000.00 (Taka Fifty thousand). A non-alumnus with this amount of donation will be an Associate Distinguished Donor Member.</span></p><p style=\"margin-left:13.7pt;text-align:justify;text-indent:\r\n-13.7pt;line-height:110%;mso-list:l0 level1 lfo1;tab-stops:13.5pt\"><span style=\"font-size: 1em; text-indent: -13.7pt;\"><br></span></p><p style=\"margin-left:13.7pt;text-align:justify;text-indent:\r\n-13.7pt;line-height:110%;mso-list:l0 level1 lfo1;tab-stops:13.5pt\"><b style=\"font-size: 1em; text-indent: -13.7pt;\">4) Grand Donor Member:</b><span style=\"font-size: 1em; text-indent: -13.7pt;\"> Donation for a Grand Donor member will be Tk. 1, 00,000.00 (Taka One lac). A non-alumnus with this amount of donation will be an Associate Grand Donor Member.</span></p>\r\n\r\n', 'registration', '15/02/2021 11:54:13 pm');
